import React from "react";
import {
  CardBody,
  Card,
  Container,
  Table,
  Row,
  Col,
  CardHeader,
} from "reactstrap";

// core components
import SimpleHeader from "components/Headers/SimpleHeader.js";
import { allStudents } from "api/Register";

//react-toastify
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

function AllStudent() {
  React.useEffect(() => {
    getAllStudents();
  }, []);

  const getAllStudents = async () => {
    try {
      const students = await allStudents();
      console.log("res", students);
      if (students.Response.status === 400) {
        toast.error("Something Went Wrong!");
      } else {
        toast.success("Register Successfull");
      }
    } catch (err) {
      toast.error("Register Failed!");
    }
  };

  return (
    <>
      <SimpleHeader name="All Student" />
      <ToastContainer
        position="bottom-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="colored"
      />
      <Container className="mt--6">
        <Card>
          <CardHeader>
            <h1>All Students</h1>
          </CardHeader>
          <CardBody>
            <Row>
              <Col>
                <div className="card-wrapper">
                  <Card>
                    <CardBody>
                      <Table bordered responsive>
                        <thead>
                          <tr>
                            <th>S No.</th>
                            <th>Place Name</th>
                            <th>pickup Time</th>
                            <th>DropTime</th>
                          </tr>
                        </thead>
                        <tbody>
                          <tr>
                            <th scope="row">1</th>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                          </tr>
                          <tr>
                            <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                          </tr>
                          <tr>
                            <th scope="row">3</th>
                            <td>Larry</td>
                            <td>the Bird</td>
                            <td>@twitter</td>
                          </tr>
                        </tbody>
                      </Table>
                    </CardBody>
                  </Card>
                </div>
              </Col>
            </Row>
          </CardBody>
        </Card>
      </Container>
    </>
  );
}

export default AllStudent;
